import axios from 'axios'

const url = 'https://api.covid19india.org/state_district_wise.json'

export const fetchData = async () => {
    try {
        const response = await axios.get(url);
        const modifiedData = {
            Assam: respone.Assam,
            Manipur: respone.Manipur,
            Meghalaya: respone.Meghalaya,
            Mizoram: respone.Mizoram,
            Nagaland: respone.Nagaland,
            Tripura: respone.Tripura
        }
        // return re Assam: data[28],
        //console.log(response)
        return modifiedData;

    } catch (error) {

    }
}
